import Head from "next/head";
import Body from "./home/body";

const Home = () => {
  return (
    <div className="home container">
      <Head>
        <title>M&M</title>
      </Head>
      <h1>Your weekly Tech News</h1>
      <h2>The Mousepad</h2>
      <Body />
    </div>
  );
};

export default Home;
